import React from "react";
import {
  LayoutDashboard,
  MessageSquare,
  CalendarDays,
  FileUp,
  Workflow,
  ClipboardList,
  LogOut,
  UsersRound,
  X,
  ChevronRight,
  Zap,
} from "lucide-react";
import { useNavigate, useLocation } from "react-router-dom";
import { motion, AnimatePresence } from "framer-motion";

interface SidebarProps {
  isOpen: boolean;
  onClose: () => void;
}

const Sidebar: React.FC<SidebarProps> = ({ isOpen, onClose }) => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: "Dashboard", icon: LayoutDashboard, path: "/dashboard" },
    { label: "Chat", icon: MessageSquare, path: "/chat" },
    { label: "Tasks", icon: ClipboardList, path: "/tasks" },
    { label: "Meetings", icon: UsersRound, path: "/meetings" },
    { label: "Calendar", icon: CalendarDays, path: "/calendar" },
    { label: "Files", icon: FileUp, path: "/files" },
    { label: "Workflows", icon: Workflow, path: "/workflows" },
  ];

  return (
    <>
      <AnimatePresence>
        {isOpen && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="fixed inset-0 bg-slate-900/20 backdrop-blur-sm z-40 lg:hidden"
            onClick={onClose}
          />
        )}
      </AnimatePresence>

      <aside
        className={`
          fixed top-0 left-0 z-50 h-screen w-64 bg-white border-r border-slate-200/60
          transform transition-transform duration-300 ease-in-out
          ${isOpen ? "translate-x-0" : "-translate-x-full"}
          lg:translate-x-0 flex flex-col
        `}
      >
        {/* Brand Section */}
        <div
          className="p-8 pb-10 flex items-center gap-3 cursor-pointer group"
          onClick={() => {
            navigate("/dashboard");
            onClose();
          }}
        >
          <div className="w-10 h-10 bg-blue-600 rounded-xl flex items-center justify-center shadow-lg shadow-blue-200 group-hover:scale-105 transition-transform">
            <img src="/logo1.png" alt="Logo" className="w-6 h-6 invert brightness-0" />
          </div>
          <div>
            <h1 className="text-xl font-bold tracking-tight text-slate-900">Collabryta</h1>
            <div className="flex items-center gap-1.5 mt-0.5">
              <Zap size={10} className="text-blue-500 fill-blue-500" />
              <span className="text-[10px] font-bold text-slate-400 uppercase tracking-wider">Pro Edition</span>
            </div>
          </div>
        </div>

        {/* Navigation */}
        <nav className="flex-1 px-4 space-y-1 overflow-y-auto custom-scrollbar">
          {navItems.map(({ label, icon: Icon, path }) => {
            const active = location.pathname === path;
            return (
              <button
                key={path}
                onClick={() => {
                  navigate(path);
                  onClose();
                }}
                className={`w-full flex items-center justify-between px-4 py-3 rounded-xl text-sm font-semibold transition-all group relative
                  ${active
                    ? "bg-blue-50 text-blue-600"
                    : "text-slate-500 hover:bg-slate-50 hover:text-slate-900"
                  }`}
              >
                <div className="flex items-center gap-3 relative z-10">
                  <Icon size={18} className={`${active ? "text-blue-600" : "text-slate-400 group-hover:text-slate-600"} transition-colors`} />
                  {label}
                </div>
                {active && (
                  <motion.div
                    layoutId="activeNav"
                    className="absolute inset-0 bg-blue-100/50 rounded-xl"
                    transition={{ type: "spring", bounce: 0.2, duration: 0.6 }}
                  />
                )}
                <ChevronRight size={14} className={`transition-all ${active ? "opacity-40" : "opacity-0 group-hover:opacity-30 group-hover:translate-x-1"}`} />
              </button>
            );
          })}
        </nav>

        {/* Footer Action */}
        <div className="p-6 mt-auto">
          <button
            onClick={() => navigate("/login")}
            className="w-full flex items-center justify-between px-5 py-4 bg-slate-50 hover:bg-slate-100 text-slate-700 rounded-2xl text-sm font-bold transition-all border border-slate-200/50 group"
          >
            <div className="flex items-center gap-3">
              <div className="p-1.5 bg-white rounded-lg border border-slate-200 shadow-sm group-hover:rotate-12 transition-transform">
                <LogOut size={16} className="text-slate-500" />
              </div>
              Sign Out
            </div>
          </button>
        </div>
      </aside>
    </>
  );
};

export default Sidebar;
